import Header from"./components/Header";
import Sidebar from "./components/SideBar";
import Recommendedvideos from "./components/Recommendedvideos";
import './App.css';

function App() {
  return (
    <div className="app">
      <Header />
      <div className="app_page">
        <Sidebar />
        <Recommendedvideos />
      </div>  
    </div>
  );
}

export default App;
